import axios from "axios";

async function getData(number) {
  try {
    const { data: users } = await axios(
      `https://jsonplaceholder.typicode.com/users/${number}`
    );
    console.log(users);
  } catch (error) {
    console.error("HATA");
  }

}

getData();
export default getData;
